/**
 * Sample React Native App
 * https://github.com/facebook/react-native
 *
 * @format
 * @flow strict-local
 */

import React from 'react';
import {
  SafeAreaView,
  ScrollView,
  StatusBar,
  StyleSheet,
  Text,
  useColorScheme,
  View,
} from 'react-native';


const App = () => {

  return (
    <SafeAreaView>
      <Text>Welcome to Your New App!</Text>

    </SafeAreaView>
  );
};

const styles = StyleSheet.create({
  center: {
    alignItems: "center", 
    justifyContent: "center", 
    flex: 1
  }
});

export default App;
